import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import character from './character';
function App(){
    return <div>
    <Header />
    <div class="notes-container"></div>
    {character.map((inf) => (
          <Note
            title={inf.charac}
            des={inf.mydesp}
          />
        ))}
    <Footer />
    </div>;
}
export default App;
